✨ В многофункциональном молодежном центре «Шанс» стартовал прием заявок на Городской конкурс «Доброволец года»!

Конкурс проводится с целью выражения общественного признания и поощрения волонтеров и волонтерских объединений города за достижения в сфере добровольчества.

К участию в конкурсе приглашаются: 
🧍‍♂️добровольцы (волонтеры) в возрасте от 14 лет, ведущие свою деятельность на территории городского округа Тольятти; 

👨‍👩‍👦добровольческие объединения, реализующие свою деятельность на территории городского округа Тольятти. 

🏆Номинации конкурса:

🧍‍♂️событийное добровольчество; 

🍃экологическое добровольчество; 

🇷🇺патриотическое добровольчество; 

💥руководитель добровольческого объединения; 

👨‍👩‍👦добровольческое объединение; 

🏅специальная номинация «Гран при». 

💥Прием заявок продлится до 25 октября. Награждение победителей состоится на XV Городском открытом форуме «Добрый Тольятти» в декабре. 

📑Всю подробную информацию можно найти в положении о конкурсе.
